ng modified files.":"Aprende m\u00e1s sobre la reparaci\u00f3n de archivos modificados.","Loading...":"Cargando\u2026","Locked Out":"Bloqueado","Locked out from logging in":"Bloqueado para acceder","Logged In":"Conectado","Logins":"Accesos","Logins and Logouts":"Accesos y cierres de sesi\u00f3n","Look up IP or Domain":"Buscar IP o dominio","Manual block by administrator":"Bloqueo manual del administrador","Next Update Check: %s":"Comprobaci\u00f3n de la pr\u00f3xima actualizaci\u00f3n: %s","No activity to report yet. Please complete your first scan.":"Todav\u00eda no hay actividad que informar. Por favor, completa tu primera exploraci\u00f3n.","No issues have been ignored.":"No se ha ignorado ning\u00fan problema.","No new issues have been found.":"No se han encontrado nuevos problemas.","No rules were updated. Please verify you have permissions to write to the \/wp-content\/wflogs directory.":"No se ha actualizado ninguna regla. Por favor, comprueba que tienes permisos para escribir en el directorio \/wp-content\/wflogs","No rules were updated. Please verify your website can reach the Wordfence servers.":"No se ha actualizado ninguna regla. Por favor, comprueba que tu web pueda acceder a los servidores de Wordfence.","No rules were updated. Your website has reached the maximum number of rule update requests. Please try again later.":"No se ha actualizado ninguna regla. Tu web ha alcanzado el n\u00famero m\u00e1ximo de solicitudes de actualizaci\u00f3n de reglas. Por favor, int\u00e9ntelo de nuevo m\u00e1s tarde.","Note: Status will update when changes are saved":"Nota: El estado se actualizar\u00e1 cuando se guarden los cambios","OK":"Aceptar","Pages Not Found":"P\u00e1ginas no encontradas","Paid Members Only":"S\u00f3lo para miembros de pago","Please enter a valid IP address or domain name for your whois lookup.":"Introduce una direcci\u00f3n IP o un nombre de dominio v\u00e1lidos para tu b\u00fasqueda de whois.","Please enter a valid email address.":"Por favor, introduce una direcci\u00f3n de correo electr\u00f3nico v\u00e1lida.","Please include your support ticket number or forum username.":"Por favor, incluye tu n\u00famero de ticket de soporte o el nombre de usuario del foro.","Please make a backup of this file before proceeding. If you need to restore this backup file, you can copy it to the following path from your site's root:":"Por favor, haz una copia de seguridad de este archivo antes de continuar. Si necesitas restaurar este archivo de copia de seguridad, puedes copiarlo en la siguiente ruta desde la ra\u00edz de tu sitio:","Please specify a reason":"Por favor, especifica una raz\u00f3n","Please specify a valid IP address range in the form of \"1.2.3.4 - 1.2.3.5\" without quotes. Make sure the dash between the IP addresses in a normal dash (a minus sign on your keyboard) and not another character that looks like a dash.":"Especifica un rango de direcciones IP v\u00e1lido en el formato \u00ab1.2.3.4 - 1.2.3.5\u00bb sin comillas. Aseg\u00farate de que el gui\u00f3n entre las direcciones IP sea un gui\u00f3n normal (un signo menos en tu teclado) y no otro car\u00e1cter que parezca un gui\u00f3n.","Please specify either an IP address range, Hostname or a web browser pattern to match.":"Por favor, especifica un rango de direcciones IP, un hostname o un patr\u00f3n de navegador web para que coincida.","Recent Activity":"Actividad reciente","Recovery Codes":"Recuperaci\u00f3n de c\u00f3digos","Redirected":"Redirigido","Redirected by Country Blocking bypass URL":"Redirigido por la URL de omisi\u00f3n de bloqueo de pa\u00eds","Referer":"Referente","Registered Users":"Usuarios registrados","Restore Defaults":"Restaurar valores por defecto","Rule Update Failed":"Fallo en la actualizaci\u00f3n de la regla","Rules Updated":"Reglas actualizadas","Save Changes":"Guardar cambios","Scan Complete.":"Exploraci\u00f3n completa","Scan the code below with your authenticator app to add this account. Some authenticator apps also allow you to type in the text version instead.":"Explora el c\u00f3digo a continuaci\u00f3n con tu aplicaci\u00f3n de identificaci\u00f3n para a\u00f1adir esta cuenta. Algunas aplicaciones de identificaci\u00f3n tambi\u00e9n te permiten escribir en la versi\u00f3n de texto en su lugar.","Security Event":"Evento de seguridad","Send":"Enviar","Sorry, but no data for that IP or domain was found.":"Lo siento, pero no se han encontrado datos para esa IP o dominio.","Specify a valid IP range":"Especifica un rango de IP v\u00e1lido","Specify a valid hostname":"Especifica un hostname v\u00e1lido","Specify an IP range, Hostname or Browser pattern":"Especifica un rango de IP, un hostname o un patr\u00f3n de navegaci\u00f3n","Success deleting file":"Archivo borrado correctamente","Success removing option":"Opci\u00f3n eliminada correctamente","Success restoring file":"Archivo restaurado correctamente","Success updating option":"Opci\u00f3n actualizada correctamente","Successfully deleted admin":"Administrador eliminado correctamente","Successfully revoked admin":"Administraci\u00f3n revocada correctamente","Test Email Sent":"Enviado el correo electr\u00f3nico de prueba","The 'How does Wordfence get IPs' option was successfully updated to the recommended value.":"La opci\u00f3n \u00ab\u00bfC\u00f3mo obtiene Wordfence las direcciones IP?\u00bb se actualiz\u00f3 correctamente al valor recomendado.","The Full Path disclosure issue has been fixed":"Se ha solucionado el problema de divulgaci\u00f3n de la ruta completa.","The admin user %s was successfully deleted.":"El usuario administrador %s se elimin\u00f3 correctamente.","The file %s was successfully deleted.":"El archivo %s se elimin\u00f3 correctamente.","The file %s was successfully hidden from public view.":"El archivo %s se ocult\u00f3 correctamente de la vista p\u00fablica.","The file %s was successfully restored.":"El archivo %s se restaur\u00f3 correctamente.","The option %s was successfully removed.":"La opci\u00f3n %s se elimin\u00f3 correctamente.","The request has been allowlisted. Please try it again.":"La solicitud se ha incluido en la lista de permitidos. Int\u00e9ntalo de nuevo.","There was an error while sending the email.":"Hubo un error al enviar el correo electr\u00f3nico.","This will be shown only once. Keep these codes somewhere safe.":"Esto se mostrar\u00e1 solo una vez. Guarda estos c\u00f3digos en un lugar seguro.","Throttled":"Atenuada","Two Factor Status":"Estado de la identificaci\u00f3n en dos factores","Type":"Tipo","Type: %s":"Tipo: %s","URL":"URL","Unable to automatically hide file":"Imposible ocultar el archivo autom\u00e1ticamente","Use one of these %s codes to log in if you are unable to access your phone. Codes are 16 characters long, plus optional spaces. Each one may be used only once.":"Usa uno de estos %s c\u00f3digos para inciar sesi\u00f3n si has habilitado el acceso en tu tel\u00e9fono. Los c\u00f3digos tienen 16 caracteres de longitud y puedes usar espacios. Cada uno solo puede ser usado una vez.","Use one of these %s codes to log in if you lose access to your authenticator device. Codes are 16 characters long, plus optional spaces. Each one may be used only once.":"Usa uno de estos %s c\u00f3digos para iniciar sesi\u00f3n si pierdes el acceso a tu cuenta. Los c\u00f3digos tienen 16 caracteres de longitud y puedes usar espacios. Cada uno solo puede ser usado una vez.","User Agent":"Agente de usuario","User ID":"ID de usuario","Username":"Nombre de usuario","WHOIS LOOKUP":"WHOIS LOOKUP","We are about to change your <em>.htaccess<\/em> file. Please make a backup of this file before proceeding.":"Vamos a modificar tu archivo <em>.htaccess<\/em>. Por favor haz un backup de este archivo antes de proceder.","We can't modify your .htaccess file for you because: %s":"No podemos modificar tu archivo .htaccess por ti debido a: %s","We encountered a problem":"Hemos encontrado un problema","Wordfence Firewall blocked a background request to WordPress for the URL %s.