s cambios de tus opciones. Si sales de esta p\u00e1gina, perder\u00e1s los cambios.","Your .htaccess has been updated successfully. Please verify your site is functioning normally.":"Tu archivo .htaccess se ha actualizado correctamente. Por favor comprueba que tu sitio funciona con normalidad.","Your Wordfence activity log was sent to %s":"Tu registro de actividad de Wordfence se envi\u00f3 a %s","Your rules have been updated successfully.":"Tus reglas se han actualizado correctamente.","Your rules have been updated successfully. You are currently using the free version of Wordfence. Upgrade to Wordfence premium to have your rules updated automatically as new threats emerge. <a href=\"https:\/\/www.wordfence.com\/wafUpdateRules1\/wordfence-signup\/\">Click here to purchase a premium license<\/a>. <em>Note: Your rules will still update every 30 days as a free user.<\/em>":"Tus reglas se han actualizado correctamente. Actualmente est\u00e1s utilizando la versi\u00f3n gratuita de Wordfence. Actualiza a Wordfence premium para que tus reglas se actualicen autom\u00e1ticamente a medida que surgen nuevas amenazas. <a href=\"https:\/\/www.wordfence.com\/wafUpdateRules1\/wordfence-signup\/\">Haz clic aqu\u00ed para comprar una licencia premium<\/a>.<em> Nota: tus reglas seguir\u00e1n actualiz\u00e1ndose cada 30 d\u00edas como usuario gratuito.<\/em>","Your test email was sent to the requested email address. The result we received from the WordPress wp_mail() function was: %s<br \/><br \/>A 'True' result means WordPress thinks the mail was sent without errors. A 'False' result means that WordPress encountered an error sending your mail. Note that it's possible to get a 'True' response with an error elsewhere in your mail system that may cause emails to not be delivered.":"Tu correo electr\u00f3nico de prueba se envi\u00f3 a la direcci\u00f3n de correo electr\u00f3nico solicitada. El resultado que recibimos de la funci\u00f3n wp_mail () de WordPress fue: %s<br \/><br \/>Un resultado \u00abVerdadero\u00bb significa que WordPress cree que el correo se envi\u00f3 sin errores. Un resultado \u00abFalso\u00bb significa que WordPress encontr\u00f3 un error al enviar tu correo. Ten en cuenta que es posible obtener una respuesta \u00abVerdadero\u00bb con un error en otra parte de tu sistema de correo que puede hacer que los correos electr\u00f3nicos no se entreguen.","blocked by firewall":"Bloqueado por el cortafuegos","blocked by firewall for %s":"bloqueado por el cortafuegos por %s","blocked by real-time IP blocklist":"bloqueado por la lista de bloqueo de IP en tiempo real","blocked by the Wordfence Security Network":"bloqueado por la red de seguridad de Wordfence","blocked for %s":"bloqueado por %s","locked out from logging in":"bloqueado para acceder"};
